class Queue:
    def __init__(self):
        self.stack1 = []
        self.stack2 = []

    def enqueue(self, item):
        self.stack1.append(item)

    def dequeue(self):
        if not self.stack2:
            while self.stack1:
                self.stack2.append(self.stack1.pop())
        return self.stack2.pop()

    def is_empty(self):
        return not self.stack1 and not self.stack2
```

In this implementation, the `enqueue` method adds an item to the top of the first stack. The `dequeue` method pops an item from the second stack, which is effectively the front of the queue. If the second stack is empty, it means that all items have been popped from the first stack, so the first stack is emptied and the second stack is used to return the front of the queue. The `is_empty` method checks if both stacks are empty, which means the queue is empty.
